comment:
RPG게임이 질리는 이유는 분명 내가 이만큼 강해졌는데 몬스터들도 계속 강해지니까 변한것이 없다는 회의감이 밀려오면서 접게 되는거다. 그러나 진짜 명작게임은 주인공캐릭터와 몬스터의 적절한 밸런스를 이뤄 성장의 묘미를 보여주고 절대 끊지 못하게 하지...

밤은 성장만 오지게하고 쎄지기는 커녕 오히려 점점 약해지고 있는것같다. 적어도 그 힘들의 활용이라도 보여줘야 하는데 몇년전에 화접공파술만 내지르는 것 빼고 달라진 점은 등에서 키힝!하고 나오는 가시 뿐... 그것조차 체감상으로는 별의미없이 느껴지는데 문제있는거 아니냐;

그리고 전투력이 단순히 ‘수치상’으로 올라가는거 말고, 그 힘의 구체적인 활용을 보고싶다. 이런 상황에는 공파술로, 저런 상황에는 가시로, 또 다른 상황에는 신원류로... 여러가지 응용적인 면이 있어야 전투씬이 재미있는 법인데 지금의 밤은 다짜고자 가시 킹 나오고 달려드는거밖에 없따.......

엔도르시가 마스체니 보다 약한게 당연한 거 아닌가요;;
엔도르시가 아무리 강하다고 해도 마스체니는 이미
선별인원 때 부터 랭커를 능가하는 능력을 보였다고 해요 
같은 자하드의 공주라고 해도 10가문 직계는 달라요
태어날 때부터 재능의 차이가 있었던 거죠;;
아도리 자하드나 마스체니 나 유리,가람처럼 13월을
하사 받은 공주들은 선별인원 때 부터 다르답니다
엔도르시가 약한게 아니라 마스체니가 터무니 없이 강할
수 밖에 없는 거에요;
